import "./App.css";
import Post from "./components/Post";

function App() {
  return (
    <main>
      <header className="flex justify-between mx-[66px] ">
        <a href="" className="font-bold text-xl">
          My Blog
        </a>
        <nav className="space-x-5 font-semibold text-xl">
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
      </header>
      <Post />
    </main>
  );
}

export default App;
